import React from 'react';

function BuscadorLibros () {
	return (
		<section className="BuscadorLibros">
			<h2>Buscador Libros</h2>
			<input type="text" placeholder="Buscar Libro" />
			<button>Buscar</button>
		</section>
	);
};

export default BuscadorLibros;
